    function selectable(
        MarketSearch.SearchArgTarget memory target_,
        MarketSearch.SearchArg memory searcharg_,
        uint256 currentqty_,
        uint256 currentquote_,
        uint256 qty_,
        uint256 quote_
    ) private pure returns (bool) {

        // qtymax qtymin watchdog
        if (target_.qty != 0)
        {
            if (target_.qtyismax && qty_ > target_.qty)
                return false;
            if (target_.qtyismin && qty_ < target_.qty)
                return false;
        }

        // None selected
        if (currentqty_ == 0)
            return true;

        // here current is active

        // qty unlimited 
        if (target_.qty == 0) 
            return qty_ > currentqty_;

        // here target_.qty != 0

        if (qty_ > target_.qty)
            return qty_ * quote_ < currentqty_ * currentquote_;

        // here qty <= target_.qty

        if (qty_ > currentqty_) return true;

        // here qty <= currentqty_

        if (qty_ == currentqty_)
            return qty_ * quote_ < currentqty_ * currentquote_; 

        // here qty < currentqty_

        return false;
    }

    function solutionQtyAvail(Solution memory sol_, Solution[] memory used_)
        private
        pure
        returns (uint256 qty_)
    {
        qty_ = sol_.qty - used_.getIdQty(sol_.orderid);
        qty_ -= qty_ % sol_.granularity;
    }


