    /**
     * @dev we iterate thru solution to seek best price solution
     * in_ filtered solutions
     * startin_ is used  for recusion
     * qty_ target qty, assert if 0, remainer should be removed from qty before calling
     * searcharg_
     *      searcharg_.maxquote IGNORED     should be already filtered
     *      searcharg_.maxavgquote          should be processed
     *      searcharg_.maxcount IGNORED     is handled is __fromTo
     *      searcharg_.used                 must be removed from solutions
     *      searcharg_.remainer IGNORED     should be removed from qty_ before call
     * used_ is the used order to exclude in recursion and count recusion
     */
    function recurseSearch(
        Solution[] memory in_,
        uint256 start_,
        MarketSearch.SearchArgTarget memory target_,
        MarketSearch.SearchArg memory searcharg_,
        Solution[] memory recursestack_ //, // , maxcount should be ignored since its the best combinaison shoot
    )
        public
        pure
        returns (
            Solution[] memory out_,
            uint256 qty_,
            Quote memory quote_
        )
    {
        require(
            target_.qty == 0 || target_.qty >= recursestack_.getQty(),
            "recurseSearch require target_.qty==0 || target_.qty >= searcharg_.used.getQty()"
        );
        Solution[] memory stack = new Solution[](
            recursestack_.length + in_.length - start_
        );
        for (uint256 j = 0; j < recursestack_.length; j++)
            stack[j] = recursestack_[j];
        uint256 stackcount = recursestack_.length;

        uint256 i = start_;
        // _recurseFromTo must be align on new granularity
       if (i > 0)
        {
            for (; i < in_.length; i++)
                if (in_[i].granularity != in_[i - 1].granularity) break;
            //require(false,StringLib.format("i={}",i.toString()));
        }
        for (; i < in_.length; i++) {
            // target qty
            uint256 qty = target_.qty;

            // if not qty unlimited
            if (qty != 0) {
                require(qty >= stack.getQty(stackcount),"recurseSearch require qty >= stack.getQty(stackcount)");
                /*require(
                    qty >= stack.getQty(stackcount),
                        StringLib.format("recurseSearch require qty >= stack.getQty(stackcount) qty={} stack.getQty={} target_.qty={}",
                            qty.toDecimalString(),
                            stack.getQty(stackcount).toDecimalString(),
                            target_.qty.toDecimalString())
                );*/
                //if (qty <= stack.getQty(stackcount))
                //    break;

                // we remove was already have in stack
                qty -= stack.getQty(stackcount);

                // we ajust qty based on granularity
                if (qty % in_[i].granularity > 0)
                {
                    if (target_.qtyismax && target_.qtyismin)
                    {
                        // jump to next granularity
                        for (; i < in_.length - 1; i++)
                            if (in_[i].granularity != in_[i + 1].granularity) break;
                        continue;
                    }
                    qty = qty - (qty % in_[i].granularity) + (target_.qtyismax ? 0 : in_[i].granularity);
                }
            }

            // here qty must be unlimited(0) or ajusted target_.qty

            // we ajust the qty based on order qty
            {
                if (
                    qty == 0 ||
                    qty > solutionQtyAvail(in_[i], searcharg_.used)
                ) qty = solutionQtyAvail(in_[i], searcharg_.used);
            }
            // nothing buyable on  this order if qty avail < granularity -> we jump to next
            if (qty < in_[i].granularity) continue;

            // adjusting qty based on maxavgquote
            if (
                searcharg_.maxavgquote != 0 &&
                in_[i].quote > searcharg_.maxavgquote
            ) {
                uint256 deltaqty = ((((stack.getQty(stackcount) *
                    searcharg_.maxavgquote) / 10**18) -
                    stack.getTotal(stackcount)) * 10**18) /
                    (in_[i].quote - searcharg_.maxavgquote);

                if (qty > deltaqty)
                    qty = deltaqty - (deltaqty % in_[i].granularity);
            }
            if (searcharg_.maxtotal != 0) {
                //uint256 _total = stack.getTotal(stackcount);
                // PARANOIA
                //require(searcharg_.maxtotal>_total,"recurseSearch require searcharg_.maxtotal>_total");

                uint256 deltaqty = ((searcharg_.maxtotal -
                    stack.getTotal(stackcount)) * 10**18) / in_[i].quote;

                if (qty > deltaqty)
                    qty = deltaqty - (deltaqty % in_[i].granularity);
            }

            // if we are under granularity here , means maxavgquote reached with granularity,
            // useless to test same granularity orders because quote will be equal or higher
            if (qty < in_[i].granularity) {
                // jump to next granularity
                for (; i < in_.length - 1; i++)
                    if (in_[i].granularity != in_[i + 1].granularity) break;
                continue;
            }

            // here qty >= granularity
            // we know we are going to use this order

            // before adding this order,we make the recurse split to next granularity as is this order never existed
            if (target_.qty != 0 && target_.qty > stack.getQty(stackcount)) {
                /*require(
                    false,
                        StringLib.format("recurseSearch target_.qty={} stack.getQty={}",
                            target_.qty.toDecimalString(),
                            stack.getQty(stackcount).toDecimalString()
                            )
                );*/
                (
                    Solution[] memory recurseout,
                    uint256 recurseqty,
                    Quote memory recursequote
                ) = recurseSearch(
                        in_,
                        i + 1,
                        target_,
                        searcharg_,
                        stack.duplicate(0, stackcount)
                    );
                if (recurseqty != 0)
                    if (
                        selectable(
                            target_,
                            searcharg_,
                            qty_,
                            quote_.quoteavg,
                            recurseqty,
                            recursequote.quoteavg
                        )
                    ) //,0))
                    {
                        out_ = recurseout;
                        qty_ = recurseqty;
                        quote_ = recursequote;
                    }
            }

            {
                stack[stackcount].orderid = in_[i].orderid;
                stack[stackcount].addr = in_[i].addr;
                stack[stackcount].qty = qty;
                stack[stackcount].granularity = in_[i].granularity;
                stack[stackcount].quote = in_[i].quote;
                stack[stackcount].delivery = in_[i].delivery;
                stackcount++;
            }

            if (
                selectable(
                    target_,
                    searcharg_,
                    qty_,
                    quote_.quoteavg,
                    stack.getQty(stackcount),
                    stack.getAvg(stackcount)
                )
            ) {
                out_ = stack.duplicate(0, stackcount);
                quote_ = Quote(0, 0, 0);
                qty_ = 0;
                for (uint256 j = 0; j < out_.length; j++) {
                    if (quote_.quotemin == 0 || quote_.quotemin > out_[j].quote)
                        quote_.quotemin = out_[j].quote;
                    if (quote_.quotemax == 0 || quote_.quotemax < out_[j].quote)
                        quote_.quotemax = out_[j].quote;
                    quote_.quoteavg += (out_[j].qty * out_[j].quote);
                    qty_ += out_[j].qty;
                }
                quote_.quoteavg /= qty_;
            }

            //if (searcharg_.maxcount!=0&&out_.length==searcharg_.maxcount)
            //    break;
            if (target_.qty != 0 && target_.qty <= stack.getQty(stackcount))
            {
                /*require(
                    false,
                        StringLib.format("recurseSearch target_.qty={} stack.getQty={}",
                            target_.qty.toDecimalString(),
                            stack.getQty(stackcount).toDecimalString()
                            )
                );*/
                break;
            }
            // if we didnt used all the capacity
            if (qty < solutionQtyAvail(in_[i], searcharg_.used)) {
                // we jump to next granularity
                for (; i < in_.length - 1; i++)
                    if (in_[i].granularity != in_[i + 1].granularity) break;
            }

        }
    }

    function recurseSearchCFilter(
        SolutionSet memory in_,
        bytes32 current_,
        MarketSearch.SearchArgTarget memory target_,
        MarketSearch.SearchArg memory searcharg_
    )
        public
        pure
        returns (SolutionSet memory out_)
    {
        SolutionSetDesc memory selecteddesc;
        {
            uint len = in_.descs.length;
            for (uint i;i<len;i++)
            {
                if (in_.descs[i].path[0]==current_&&in_.descs[i].path[in_.descs[i].path.length-1]==target_.currency)
                {
                    if (selecteddesc.qty ==0 || selecteddesc.quote.quoteavg > in_.descs[i].quote.quoteavg)
                        selecteddesc = in_.descs[i];
                }
                out_.add(in_.descs[i],in_.solutions);
            }
        }
        if (selecteddesc.qty!=0)
        {
            out_.qty = selecteddesc.qty;
            out_.quote=  selecteddesc.quote;
            out_ = out_.add(selecteddesc,in_.solutions);
        }
    }
